import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import Navbar from '../components/Navbar';

function HomePage() {
  const navigate = useNavigate();
  const [recentVehicles, setRecentVehicles] = useState([]);
  const [loading, setLoading] = useState(true);

  const handleLogout = () => {
    localStorage.removeItem('token');
    window.location.href = '/';
  };

  const handleAddNewEntry = () => {
    navigate('/new-entry');
  };

  useEffect(() => {
    // Fetch last 10 vehicles
    fetch('http://localhost:5000/api/vehicles?limit=10')
      .then(res => res.json())
      .then(data => {
        setRecentVehicles(data.vehicles || []);
        setLoading(false);
      })
      .catch(() => setLoading(false));
  }, []);

  return (
    <>
      <Navbar onLogout={handleLogout} showProfile={true} />
      <div className="dashboard-section">
        {/* Mini dashboard with stats */}
      </div>
      <div className="recent-vehicles-section">
        <h2>Recent Vehicles</h2>
        {loading ? (
          <div>Loading...</div>
        ) : recentVehicles.length === 0 ? (
          <div>No records found.</div>
        ) : (
          <table>
            <thead>
              <tr>
                <th>Vehicle Registration Number</th>
                <th>Vehicle Type</th>
                <th>Date Created</th>
              </tr>
            </thead>
            <tbody>
              {recentVehicles.map(vehicle => (
                <tr key={vehicle.id}>
                  <td>{vehicle.registration_number}</td>
                  <td>{vehicle.asset_type}</td>
                  <td>{vehicle.entry_datetime ? new Date(vehicle.entry_datetime).toLocaleString() : ''}</td>
                </tr>
              ))}
            </tbody>
          </table>
        )}
      </div>
      <button onClick={handleAddNewEntry}>Add New Entry</button>
      <div className="search-section">
        {/* Search by date, vehicle number, type */}
      </div>
    </>
  );
}

export default HomePage;
